    FunctionName: 'my-function',
    InvokeArgs: JSON.stringify({ message: 'hello lambda' })
  }

  await Lambda.invokeAsync(invokeAsyncReq).promise()
}

packages/lambda-powertools-middleware-co.body:
lambda-powertools-middleware-correlation-ids
A Middy middleware that extracts correlation IDs from the invocation event and stores them with the @dazn/lambda-powertools-correlation-ids package.
Main features:

stores correlation IDs with the @dazn/lambda-powertools-correlation-ids package

supports API Gateway events (HTTP headers)

supports SNS events (message attributes)

supports SQS events (message attributes with and without raw message delivery when published from SNS)

supports Kinesis events (see below for more details)

supports direct invocations and Step Function tasks (the middleware looks for a __context__ property in the JSON event)

initializes correlation IDs using the Lambda request ID

captures anything with prefix x-correlation-

cpatures User-Agent from API Gateway events

captures or initializes the debug-log-enabled decision based on configuration (see below) to ensure invocation follows upstream decision to enable debug logging for a small % of invocations


Getting Started
Install from NPM: npm install @dazn/lambda-powertools-middleware-correlation-ids
Alternatively, if you use the template @dazn/lambda-powertools-pattern-basic then this would be configured for you.
API
Accepts a configuration object of the following shape:
{
  sampleDebugLogRate: double [between 0 and 1]
}

const middy = require('middy')
const correlationIds = require('@dazn/lambda-powertools-middleware-correlation-ids')

const handler = async (event, context) => {
  return 42
}

module.exports = middy(handler)
  .use(correlationIds({ sampleDebugLogRate: 0.01 }))
}

This middleware is often used alongside the @dazn/lambda-powertools-middleware-sample-logging middleware to implement sample logging. It's recommended that you use the @dazn/lambda-powertools-pattern-basic which configures both to enable debug logging at 1% of invocations.
Logging and Forwarding correlation IDs
Note: this does not apply to Kinesis and SQS event sources, whose invocation events contain a batch of records and require different handling. Please see section below for more details.
Once you have wrapped your handler code, the correlation IDs would be automatically included when:

you log with the @dazn/lambda-powertools-logger logger
when you make HTTP requests with the @dazn/lambda-powertools-http-client HTTP client
when you interact with AWS with the various AWS SDK clients from this project

If you're using these accompanying packages then correlation IDs would simply pass through your function. However, if you wish to augment existing correlation IDs then you can also add new correlation IDs to the mix with the @dazn/lambda-powertools-correlation-ids package.
Logging and Forwarding correlation IDs for Kinesis and SQS events
Because Kinesis and SQS both supports batching, it means that the invocation event can contain multiple records. Each of these records would have its own set of correlation IDs.
To address this, this middleware would extract the correlation IDs for each record and make it available for you, as well as creating a dedicated logger instance for each record. How this happens depends on the event source.
The HTTP client as well as AWS SDK clients from this project all have an override that lets you pass in these record-specific correlation IDs.
Kinesis
For kinesis events, the middleware would do the following for each record:

Unzip; base64 decode; parse as JSON; and extract correlation IDs from the record body (in the __context__ property).

Create an instance of CorrelationIds (from the @dazn/lambda-powertools-correlation-ids package) to hold all the extracted correlation IDs.

Create an instance of Log (from the @dazn/lambda-powertools-logger package) with the extracted correlation IDs already baked in.

Attach the correlation IDs and logger to the parsed JSON object.

Include the parsed JSON objects from step 4. in context.parsedKinesisEvents.


When using the HTTP client and AWS SDK clients from the powertools packages, you will need to include them as options or using one of the overload methods. For example:

Here's an example function.
const Log = require('@dazn/lambda-powertools-logger')
const SNS = require('@dazn/lambda-powertools-sns-client')
const wrap = require('@dazn/lambda-powertools-pattern-basic')

module.exports.handler = wrap(async (event, context) => {
  const events = context.parsedKinesisEvents

  // you can still use the global Log instance, it'll still have the request ID for
  // the current invocation, but it won't have any of the correlation IDs for the
  // individual records
  Log.debug('received Kinesis events', { count: events.length })

  await Promise.all(events.map(evt => {
    // each parsed kinesis event has a `logger` attached to it, with the correlation IDs
    // specific for that record
    evt.logger.debug('publishing kinesis event as SNS message...')

    const req = {
      Message: JSON.stringify(evt),
      TopicArn: process.env.TOPIC_ARN
    }

    // the SNS client has an overload method for publish, which lets you pass the
    // correlation IDs specific to this parsed kinesis event
    return SNS.publishWithCorrelationIds(evt.correlationIds, req).promise()
  }))
})

SQS
For SQS events, the middleware would do the following for each record:

Eextract correlation IDs from the message attribtues.

Create an instance of CorrelationIds (from the @dazn/lambda-powertools-correlation-ids package) to hold all the extracted correlation IDs.

Create an instance of Log (from the @dazn/lambda-powertools-logger package) with the extracted correlation IDs already baked in.

Attach the correlation IDs and logger to the original SQS record object.


When using the HTTP client and AWS SDK clients from the powertools packages, you will need to include them as options or using one of the overload methods. This is similar to the Kinesis example above. Here's an example function:
const Log = require('@dazn/lambda-powertools-logger')
const SNS = require('@dazn/lambda-powertools-sns-client')
const wrap = require('@dazn/lambda-powertools-pattern-basic')

module.exports.handler = wrap(async (event, context) => {
  // you can still use the global Log instance, it'll still have the request ID for
  // the current invocation, but it won't have any of the correlation IDs for the
  // individual records
  Log.debug('received SQS events', { count: event.Records.length })

  await Promise.all(event.Records.map(record => {
    // each SQS record has a `logger` attached to it, with the correlation IDs
    // specific for that record
    record.logger.debug('publishing SQS record as SNS message...')

    const req = {
      Message: JSON.stringify(record),
      TopicArn: process.env.TOPIC_ARN
    }

    // the SNS client has an overload method for publish, which lets you pass the
    // correlation IDs specific to this SQS record
    return SNS.publishWithCorrelationIds(record.correlationIds, req).promise()
  }))
})

packages/lambda-powertools-middleware-lo.body:
lambda-powertools-middleware-log-timeout
A Middy middleware that will log a timeout error message just before the function actually times out.
Main features:

records an error log message invocation timed out (with the invocation event as attribute) when an invocation times out

Getting Started
Install from NPM: npm install @dazn/lambda-powertools-middleware-log-timeout
Alternatively, if you use the template @dazn/lambda-powertools-pattern-basic then this would be configured for you.
API
The middleware accepts an optional constructor parameter thresholdMillis, which is the number of millis before an invocation is timed out, that an error message is logged. thresholdMillis defaults to 10ms.
const middy = require('middy')
const logTimeout = require('@dazn/lambda-powertools-middleware-log-timeout')

const handler = async (event, context) => {
  return 42
}

module.exports = middy(handler)
  // or .use(logTimeout(50)) to log the timeout error message 50ms before invocation times out
  .use(logTimeout()) // defaults to 10ms
}

It's recommended that you use the @dazn/lambda-powertools-pattern-basic which configures this middleware along with other useful middlewares.

packages/lambda-powertools-middleware-ob.body:
lambda-powertools-middleware-obfuscater
A Middy middleware that will enable debug logging for a configurable % of invocations. Defaults is 1%.
Main features:

records an error log message with the invocation event as attribute when an invocation errors. These invocation errors may be obfuscated to avoid the leaking of Personal Identifiable Information.

Getting Started
Install from NPM: npm install @dazn/lambda-powertools-middleware-obfuscater
Alternatively, if you use the template @dazn/lambda-powertools-pattern-obfuscate then this would be configured for you.
API
Accepts a configuration object of the following shape:
{
  obfuscationFilter: string array formatted like ["object.key.to.obfuscate"]
}

  {
    Records: [
        { firstName: "personal" secondName: "identifiable" email: "inform@ti.on" },
        { firstName: "second" secondName: "personal" email: "inform@ti.on" }
      ]
  }

  // To filter the above object you would pass
  const obfuscationFilter = ["Records.*.firstName", "Records.*.secondName", "Records.*.email"]

The output would be...
{
  Records: [
      { firstName: "********" secondName: "************" email: "******@**.**" },
      { firstName: "******" secondName: "********" email: "******@**.**" }
    ]
}

similarly, you can filter entire objects, for instance.
  const obfuscationFilter = ["Records.*.personal"]
  {
    Records: [
      { personal: { firstName: "********" secondName: "************" email: "******@**.**" } }.
      { personal: { firstName: "******" secondName: "********" email: "******@**.**", address: { postcode: "******", street: "* ****** ***", country: "**" }}}
    ]
  }

This will recursively filter every object and subobjects
const middy = require('middy')
const obfuscatedLogging = require('@dazn/lambda-powertools-middleware-obfuscater')

const handler = async (event, context) => {
  return 42
}

module.exports = middy(handler)
  .use(obfuscatedLogging({ sampleRate: 0.01, obfuscationFilters: ["example.example"] }))
}

This middleware is often used alongside the @dazn/lambda-powertools-middleware-correlation-ids middleware to implement sample logging. It's recommended that you use the @dazn/lambda-powertools-pattern-obfuscate which configures both to enable debug logging at 1% of invocations.

packages/lambda-powertools-middleware-st.body:
lambda-powertools-middleware-stop-infinite-loop
A Middy middleware that will stop an invocation if it's deemed to be part of an infinite loop.
Main features:

errors if the call-chain-length reaches the configured threshold (defaults to 10)

Getting Started
Install from NPM: npm install @dazn/lambda-powertools-middleware-stop-infinite-loop
API
The middleware accepts an optional constructor parameter threshold, which is the max length allowed for the entire call chain.
This middleware is intended to be used alongside @dazn/lambda-powertools-middleware-correlation-ids, which is responsible for collecting correlation IDs and incrementing the call-chain-length (i.e. the number of function invocations that are chained together) at the start of an invocation.
Because this middleware relies on @dazn/lambda-powertools-middleware-correlation-ids, it needs to be applied AFTER @dazn/lambda-powertools-middleware-correlation-ids (as seen below).
const middy = require('middy')
const correlationIds = require('@dazn/lambda-powertools-middleware-correlation-ids')
const stopInfiniteLoop = require('@dazn/lambda-powertools-middleware-stop-infinite-loop')

const handler = async (event, context) => {
  return 42
}

module.exports = middy(handler)
  .use(correlationIds())
  .use(stopInfiniteLoop()) // defaults to 10
}

packages/lambda-powertools-correlation-i.body:
lambda-powertools-correlation-ids
A helper module for recording correlation IDs.
Main features:

allows you to fetch, update, and delete correlation IDs

respects convention for correlation IDs - i.e. x-correlation-

allows you to store more than one correlation IDs, which allows you to correlate logs on multiple dimensions (e.g. by x-correlation-user-id, or x-correlation-order-id, etc.)


Getting Started
Install from NPM: npm install @dazn/lambda-powertools-correlation-ids
API
const CorrelationIds = require('@dazn/lambda-powertools-correlation-ids')

// automatically inserts 'x-correlation-' prefix if not provided
CorrelationIds.set('id', '12345678') // records id as x-correlation-id
CorrelationIds.set('x-correlation-username', 'theburningmonk') // records as x-correlation-username

const myCorrelationIds = CorrelationIds.get()
// {
//   'x-correlation-id': '12345678',
//   'x-correlation-username': 'theburningmonk'
// }

CorrelationIds.clearAll() // removes all recorded correlation IDs
CorrelationIds.replaceAllWith({  // bypasses the 'x-correlation-' convention
  'DEBUG-LOG-ENABLED': 'true',
  'User-Agent': 'jest test'
})

In practice, you're likely to only need set when you want to record correlation IDs from your function.
The middleware, @dazn/lambda-powertools-middleware-correlation-ids, would automatically capture the correlation IDs from the invocation event for supported event sources:

API Gateway (via HTTP headers)

Kinesis (via the JSON payload)

SNS (via message attributes)

any invocation event with the special field __context__ (which is how we inject them with the Step Functions and Lambda clients below)


Whilst other power tools would use get to make use of the correlation IDs:

@dazn/lambda-powertools-logger includes recorded correlation IDs in logs

@dazn/lambda-powertools-http-client includes recorded correlation IDs as HTTP headers when you make a HTTP request

@dazn/lambda-powertools-sns-client includes recorded correlation IDs as SNS message attributes when you publish a message to SNS (ie. SNS.publish)

@dazn/lambda-powertools-kinesis-client injects recorded correlation IDs as part of the event payload when you publish event(s) to Kinesis (ie. Kinesis.putRecord and Kinesis.putRecords)

@dazn/lambda-powertools-step-functions-client injects recorded correlation IDs as part of the payload when you start a Step Functions execution (ie. SFN.startExecution)

@dazn/lambda-powertools-lambda-client injects recorded correlation IDs as part of the invocation payload when you invoke a Lambda function directly (ie. Lambda.invoke and Lambda.invokeAsync)
